func sieve(n int) []int {
	n++
	vis := make([]bool, n)
	res := []int{}
	for i, v := range vis {
		if i < 2 {
			continue
		}
		if v == false {
			res = append(res, i)
			for j := i + i; j < n; j += i {
				vis[j] = true
			}
		}
	}
	return res
}

func nextPermutation(a []int) bool {
	la := len(a)
	if la < 2 {
		return false
	}

	begin := 0
	end := la
	i := end - 1
	for {
		j := i
		i--
		if a[i] < a[j] {
			k := end - 1
			for !(a[i] < a[k]) {
				k--
			}
			a[i], a[k] = a[k], a[i]
			for m, n := j, end-1; m < n; m, n = m+1, n-1 {
				a[m], a[n] = a[n], a[m]
			}
			return true
		}
		if i == begin {
			for m, n := begin, end-1; m < n; m, n = m+1, n-1 {
				a[m], a[n] = a[n], a[m]
				return false
			}
		}
	}
}

func generate() []int {
	primes := sieve(1000)
	fmt.Println(len(primes), "primes")

	v := make([]int, len(primes))
	v[len(primes)-1] = 1
	v[len(primes)-2] = 1
	v[len(primes)-3] = 1

	lucky := make([]int, 1000)
	for i := range lucky {
		lucky[i] = 1000000000
	}

	count := 0
	lastPrint := 0
	for {
		n := int64(1)
		for i, v := range v {
			if v == 1 {
				n *= int64(primes[i])
			}
		}

		count++
		if n < int64(lucky[999]) {
			lucky[999] = int(n)
			sort.Ints(lucky)
			if count-lastPrint > 1000000 {
				fmt.Println(count, n, lucky[999])
				lastPrint = count
			}
		}
		if nextPermutation(v) == false {
			break
		}
	}
	return lucky
}

